import React from 'react';
import './severity.scss';


class Severity extends React.Component {
  render() {
    return (
      <div>
        <div class="severity">
          <div className="square"></div>
          <div className="square"></div>
          <div className="square"></div>
          <div className="square"></div>
          <a href="#">1</a>
          <a class="active" href="#">2</a>
          <a href="#">3</a>
          <a href="#">4</a>
          <a href="#">5</a>
          <a href="#">6</a>
        </div>
      </div>
    );
  }
}

export default Severity;
